def remove_ascii(dct):
	return dict([(k.encode('ascii','ignore'), v.encode('ascii','ignore')) for k, v in dct.items()])

def convert_float(arr_of_dict):
	new_arr = [ {float(k):d[k] for k in d.keys()} for d in arr_of_dict]
	return new_arr

def convert_int(arr_of_dict):
	new_arr = [ {int(k):d[k] for k in d.keys()} for d in arr_of_dict]
	return new_arr

def read_json_data(expt_name):
	with open("Expts_Data/" + expt_name + '.txt') as jf:
		data = json.load(jf)
		global per_run_time, per_run_last_colln_end, per_run_expl_finish, per_run_clean_exit, per_run_stime_area, per_run_area_in_stime
		global per_run_total_area, per_run_total_GT_area, per_run_stime_GT_area, per_run_GT_area_in_stime
		# print(data["area_in_stime"], convert_float(data["area_in_stime"]))
		# print(data["stime_area"], convert_int(data["stime_area"]))
		print("FOR expt ", expt_name, " datalen: ", len(data["total_time"]))
