		per_run_expl_finish[expt_name] = data["expl_finished"]
		per_run_clean_exit[expt_name] = data["clean_finish"]
		per_run_stime_area[expt_name] = convert_int(data["stime_area"])
		per_run_area_in_stime[expt_name] = convert_float(data["area_in_stime"])
